import React from 'react'
import NavbarSide from '../components/NavbarSide/Index';
import NavbarTop from "../components/NavbarTop/Index"
import { useSelector } from "react-redux";
import { Redirect, NavLink } from 'react-router-dom';


const Dashboard = () => {
    const { user: currentUser } = useSelector((state) => state.auth);

    if (!currentUser) {
      return <Redirect to="/login" />;
    }
    return (
        <div id="wrapper">
            <NavbarSide/>
            <div class="d-flex flex-column" id="content-wrapper">
                <div id="content">
                <NavLink className="nav-link" activeStyle={{borderBottom: 'solid 3px #fff', paddingBottom: '1em'}} exact to="dashboard"><FaTachometerAlt className="fa " style={{'transform': 'scale(1.22)','margin-bottom': '4px'}} /><span style={{'margin': '13px'}}>&nbsp;Dashboard</span></NavLink>
                    <NavbarTop />
                    <h1></h1>
                </div>
            </div>
        </div>
    )
}

export default Dashboard
